IQ Boost is a game with tricky puzzles, tasks and logic tests. 
All the tasks are original and funny! We said ‘NO’ to boring brain training.
Free IQ Boost game features only the best tasks, brainteasers and exercises to train your memory, attention, logic and mindset. 


Only 10% of all the people have an IQ higher than 120. Are you among them? Play IQ Boost - challenge your brain.

Try yourself in solving nontrivial tasks. You will train logical and abstract thinking by solving puzzles and logic tasks. Сoncentration and memory will be better too. 
Have a good time while training your brain. 

Find out your IQ level. Lower than you thought? Play IQ Boost and you’ll see your IQ is growing. 

Game features:
• Easy to play;
• Nonstandard colourful gameplay;
• Funny answers and solutions;
• Nontrivial challenges for any age;
• Lots of levels;
• Intellectual brain-teaser game.

Remember: obvious solutions might not be not always right...think out of the box and train your brain! Play and prove you are the cleverest!

Is a dollar in your pocket and a room in the dorm all you have for now? Prove that you were born for a better life! Become a successful businessman, earn millions of dollars and run your own company in “My Success Story”.


Write your own success story


Achieve all the goals by yourself: get the first job, rent an apartment and start climbing the career ladder. Save money to start your own business. How long will it take earning your first million? It depends on you. You have all the chances in “My Success Story”.


What goals will you have in “My Success Story”?


- Would you like to live in your own house? Find a job to rent your first apartment;

- Are you dreaming of a brilliant career? Graduate from a university to take a high post;

- Is social status important for you? Get married and make a family to enhance your position in the society;

- Do you possess millions of dollars, but it is still not enough? Win in casino and bet on the stock market to double your income;

- Would you like to drive a luxurious car? You can buy as many cars as you want with all your fortune. And you will still have enough to buy several villas, a personal plane or even an island!


In “My Success Story” you can have everything you want! Earn billions of dollars, gain an endless power and write your own success story!
